import TextField from '@material-ui/core/TextField';
import { createMuiTheme } from '@material-ui/core/styles';
const theme = createMuiTheme({
    palette: {
      primary: {
        light: '#2196f3',
        main: '#3f50b5',
        dark: '#002884',
        contrastText: '#fff',
      },
      secondary: {
        light: '#ff7961',
        main: '#f44336',
        dark: '#ba000d',
        contrastText: '#000',
      },
    },
  });

const styleInput = {
    height: '100px',
    width: '25ch'
};

const Login = () =>{
    return(
        <form style={styleInput}>
             <TextField 
                required
                class="Input"
                label="Outlined secondary"
                defaultValue="YourEmail@mail.com"
                variant="outlined"
                color="secondary"
            />
        </form>
    )
}

export default Login;
